import React, {Component, createElement} from 'react';
import './SongStyle/SongStyle.css';
import Axios from 'axios';


class Song extends Component{
      constructor(props){
        super(props)
        this.state = {
          tracks: []
        }
      }



      GetProfiles() {
        const a = Axios.get('http://localhost:3210/profile').then ((response) => { this.setState({tracks: response.data})})
      }
      render(){
        this.GetProfiles;
      return(
        <div>
            {/* <SongHead compName = 'Billie Eilish' name = 'All The Good Girls Go to Hell' capo = '4th fret'/> */}

                {this.props.tracks.map(( value) => {
                    return (
                        <SongText
                            adress = {value.adress}
                            avatar = {valuea.avatars}
                            email = {value.email}
                            id = {value.id}
                            name = {value.name}
                        />
                    );
                })}
        </div>
      );
    }

}

const SongHead = props =>(
    <div>
        <span><h1>{props.compName}</h1>
        <h3>{props.name}</h3></span>
        <span><h6>Capo: {props.capo}</h6></span>
        <span>----------------------------</span>
    </div>
);

const SongText = props =>(
  <div>
    <span>{`adress: ${props.adress}`}</span>
    <span>{`avatar: ${props.avatar}`}</span>
    <span>{`email: ${props.email}`}</span>
    <span>{`id: ${props.id}`}</span>
    <span>{`name: ${props.name}`}</span>
  </div>
)

export default Song;
